import { useEffect } from 'react';
import Home from './components/Home'
import Navigator from './components/Navigator'

import 'bootstrap/scss/bootstrap.scss'

function App() {
  const hasContent = true;
  const URL = 'http://localhost:8080/restaurant/RM77EX'

  useEffect(() =>{
    async function getList(){
      const res = await fetch(URL)
      const list = await res.json()
      console.log(list)
    }
    getList()
  },[]
)
  return (
   <>
   <Navigator />
   {/* This part controls whether the json data of restaurants is empty or not */}
   {hasContent ? <Home /> : <span>Sorry there is nothing there</span>}


   </>
  );
}

export default App;
